import React from 'react'
import styled from 'styled-components'

const InputAccount = styled.div`
 padding: 5px 12px;
 margin: 0 0 10px;

`

const Input = () => {
  return (
    <div>
    <InputAccount><input type="text"/></InputAccount>
 
    </div>
  )
}

export default Input
